import { React } from "react";
import { BackgroundDiv, DivTitulo, SubTitulo, TextoBranco, TiraAzul, Titulo } from "./index.js";

const HomePage = () => {

  return (
    <BackgroundDiv>
        <DivTitulo>
      <Titulo>
        {"Porco Rosso"}
      </Titulo>
      <SubTitulo>
        {"Pizzaria"}
      </SubTitulo>
        </DivTitulo>
      <TiraAzul>
        <TextoBranco>
            {"menu"}
        </TextoBranco>
        <TextoBranco>
            {"sobre nós"}
        </TextoBranco>
      </TiraAzul>
    </BackgroundDiv>
  );
};

export { HomePage };
